import React, { Component } from "react";

class About extends Component {
  state = {};
  render() {
    return (
      <div className="row">
        <div className="d-md-inline-flex justify-content-center">
          <img
            src={require("../imgs/slide-5.png")}
            className="img-fluid"
            alt=""
            width="100%"
            height="auto"
          />
        </div>
      </div>
    );
  }
}

export default About;
